  fullName: System.Printing.PageQualitativeResolution
  type: Enum
  summary: "页面的分辨率指定作为定性、 非数字值。"
  remarks: "作为替代方法或补充，指出分辨率以每英寸点数 (dpi)，可以使用此类型。       此枚举用于提供的值<xref:System.Printing.PageResolution.QualitativeResolution%2A>属性。</xref:System.Printing.PageResolution.QualitativeResolution%2A> <xref:System.Printing.PageResolution>类，反过来，用于提供的值<xref:System.Printing.PrintCapabilities.PageResolutionCapability%2A>属性，它指定打印机支持，各种分辨率和<xref:System.Printing.PrintTicket.PageResolution%2A>属性，其中它指示打印机要使用的分辨率。</xref:System.Printing.PrintTicket.PageResolution%2A> </xref:System.Printing.PrintCapabilities.PageResolutionCapability%2A> </xref:System.Printing.PageResolution>"
  syntax:
    content: public enum PageQualitativeResolution
  inheritance:
